            '<p>After having used the lab, you should know:</p><p style="margin-left: 20px;"><br>- what particles are present in an atom;</p><p><br></p><p style="margin-left: 20px;">- the relative mass, and the mass in Kg of these particles</p><p><br></p><p style="margin-left: 20px;">- the relative charge, and the charge in C (coulomb) of these particles</p><p style="margin-left: 20px;"><br>- where the particles are located;</p><p style="margin-left: 20px;"><br>- how many particles each element has, and the difference between a neutral atom and an ion;</p><p style="margin-left: 20px;"><br>- what the atomic number is, and what information we get from this;</p><p style="margin-left: 20px;"><br>- what mass number is, and how you can calculate it;</p><p style="margin-left: 20px;"><br>- how to note symbol with atomic number, mass number and electric charge.</p><p><br></p><p><br></p><p><br></p><p><br></p>',
